$(function() {
  /* ChartJS
   * -------
   * Data and config for chartjs
   */
  'use strict';


  // Get context with jQuery - using jQuery's .get() method.
  if ($("#humidityChart").length) {
    var humidityChartCanvas = $("#humidityChart").get(0).getContext("2d");
    // This will get the first returned node in the jQuery collection.
    var humidityChart = new Image(); 
	  humidityChart.onload = function() {
	  humidityChartCanvas.drawImage(humidityChart, 1, 1); 
	  };
	  humidityChart.src  = 'data:image/png;base64,%0A'; 
	  
  }

  if ($("#maxChart").length) {
    var maxChartCanvas = $("#maxChart").get(0).getContext("2d");
    var maxChart = new Image(); 
	  maxChart.onload = function() {
	  maxChartCanvas.drawImage(maxChart, 1, 1); 
	  };
	  maxChart.src  = 'data:image/png;base64,%0A'; 
	  
  }



  if ($("#cloudinessChart").length) {
    var cloudinessChartCanvas = $("#cloudinessChart").get(0).getContext("2d");
    var cloudinessChart = new Image(); 
	  cloudinessChart.onload = function() {
	  cloudinessChartCanvas.drawImage(cloudinessChart, 1, 1); 
	  };
	  cloudinessChart.src  = 'data:image/png;base64,%0A';
  }

  if ($("#windSpeed").length) {
    var windSpeedChartCanvas = $("#windSpeed").get(0).getContext("2d");
    var windSpeedChart = new Image(); 
	  windSpeedChart.onload = function() {
	  windSpeedChartCanvas.drawImage(windSpeedChart, 1, 1);
	  };
	  windSpeedChart.src  = 'data:image/png;base64,%0A';
  }


});